import React from "react";
import { connect } from "react-redux";

function Form() {
  return (
    <>
      <form>
        <label htmlFor="name">Name</label>
        <input id="name" type="text" />
        <input type="number" />
        <input type="email" />
        <button type="submit"></button>
      </form>
    </>
  );
}

export default connect()(Form);
